import { Injectable } from '@angular/core';
import { ValidatorFn } from '@angular/forms';
import { AuthTranslationLanguageCode, BluiAuthTranslations } from '../../translations/auth-translations';
import { bluiAuthEnglishTranslations } from '../../translations/english';
import { bluiAuthFrenchTranslations } from '../../translations/french';
import { bluiAuthSpanishTranslations } from '../../translations/spanish';
import { bluiAuthChineseTranslations } from '../../translations/chinese';

export const BLUI_LOGIN_VALIDATOR_ERROR_NAME = 'BLUI_LOGIN_VALIDATOR_ERROR_NAME';

export type PasswordRequirement = {
    description: string;
    regex: RegExp;
};

@Injectable({
    providedIn: 'root',
})
export class BluiAuthConfig {
    authGuardRedirectRoute = undefined;

    languageCode: AuthTranslationLanguageCode = 'EN';
    customTranslations: BluiAuthTranslations;
    allowDebugMode = false;
    showRememberMe = true;

    projectImage: string;
    backgroundImage: string;

    contactEmail = 'placeholder-support@eaton.com';
    contactPhone = '1-800-123-4567';

    eula: string;
    eulaScrollLock = true;

    /* Conditional Pages */
    showCreateAccount = true;
    showContactSupport = true;
    showForgotPassword = true;
    showResetPassword = true;
    showCreateAccountViaInvite = true;

    /* Password requirements */
    defaultPasswordRequirements = {
        characterLimit: true,
        uppercaseLetter: true,
        lowercaseLetter: true,
        requireNumber: true,
        specialCharacter: true,
    };
    customPasswordRequirements: PasswordRequirement[] = [];

    /** Custom first name requirements used in the account registration pages. */
    customFirstNameRequirements: { maxLength: number } = undefined;

    /** Custom last name requirements used in the account registration pages. */
    customLastNameRequirements: { maxLength: number } = undefined;
    customEmailValidator: ValidatorFn;

    getTranslations(): BluiAuthTranslations {
        if (this.customTranslations) {
            return this.customTranslations;
        }
        switch (this.languageCode) {
            case 'EN': {
                return bluiAuthEnglishTranslations;
            }
            case 'FR': {
                return bluiAuthFrenchTranslations;
            }
            case 'ES': {
                return bluiAuthSpanishTranslations;
            }
            case 'ZH': {
                return bluiAuthChineseTranslations;
            }
            default: {
                return bluiAuthEnglishTranslations;
            }
        }
    }

    getPasswordRequirements(): PasswordRequirement[] {
        const req: PasswordRequirement[] = [];
        if (this.defaultPasswordRequirements.characterLimit) {
            req.push({
                description: this.getTranslations().PASSWORD_CRITERIA.CHARACTER_LIMIT,
                regex: /^.{8,16}$/,
            });
        }
        if (this.defaultPasswordRequirements.requireNumber) {
            req.push({
                description: this.getTranslations().PASSWORD_CRITERIA.ONE_NUMBER,
                regex: /[0-9]/,
            });
        }
        if (this.defaultPasswordRequirements.uppercaseLetter) {
            req.push({
                description: this.getTranslations().PASSWORD_CRITERIA.ONE_UPPERCASE_CHARACTER,
                regex: /[A-Z]/,
            });
        }
        if (this.defaultPasswordRequirements.lowercaseLetter) {
            req.push({
                description: this.getTranslations().PASSWORD_CRITERIA.ONE_LOWERCASE_CHARACTER,
                regex: /[a-z]/,
            });
        }
        if (this.defaultPasswordRequirements.specialCharacter) {
            req.push({
                description: this.getTranslations().PASSWORD_CRITERIA.ONE_SPECIAL_CHARACTER,
                regex: /[!"#$%&'()*+,-./:;<=>?@[\]^`{|}~]+/,
            });
        }
        return req.concat(this.customPasswordRequirements);
    }
}

import { ErrorStateMatcher } from '@angular/material/core';
import { FormControl, FormGroupDirective, NgForm } from '@angular/forms';
import { AUTH_ROUTES } from '../auth/auth.routes';

/** Error when invalid control is touched, or submitted. */
export class AuthErrorStateMatcher implements ErrorStateMatcher {
    manualError: string;

    setManualError(err: string): void {
        this.manualError = err;
    }

    isErrorState(control: FormControl | null, form: FormGroupDirective | NgForm | null): boolean {
        const isSubmitted = form && form.submitted;
        return Boolean(this.manualError) || !!(control && control.invalid && (control.touched || isSubmitted));
    }
}

export class ManualErrorStateMatch implements ErrorStateMatcher {
    isErrorState(): boolean {
        return true;
    }
}

export class CrossFieldErrorMatcher implements ErrorStateMatcher {
    manualError: string;

    setManualError(err: string): void {
        this.manualError = err;
    }

    isErrorState(control: FormControl | null): boolean {
        return Boolean(this.manualError) || ((control.touched || control.dirty) && control.invalid);
    }
}

// Returns true if a route (minus params) equals a target route
export const matchesRoute = (route: string, authRouteKey: keyof typeof AUTH_ROUTES): boolean => {
    const authRoute = `/${AUTH_ROUTES.AUTH_WORKFLOW}/${AUTH_ROUTES[authRouteKey]}`.replace('//', '/');
    const urlNoParams = route.split('?')[0];
    return urlNoParams === authRoute;
};

import { Injectable } from '@angular/core';
import { Observable, Subject } from 'rxjs';
import { NavigationStart, Router } from '@angular/router';
import { BluiAuthConfig } from '../../services/config/auth-config';
import { AUTH_ROUTES } from '../../auth/auth.routes';
import { matchesRoute } from '../../util/matcher';

export type SecurityContext = {
    /**
     * Email of the authenticated user.
     */
    email?: string;
    /**
     * UserId of the authenticated user (may be an email).
     */
    userId?: string;
    /**
     * Information for a user who wants to be remembered upon logout.
     */
    rememberMeDetails: {
        /**
         * Email address to show in the email field of Login after logout.
         */
        email?: string;
        /**
         * When true, the user's email will be in the email field of Login.
         */
        rememberMe?: boolean;
    };
    /**
     * True: The security state is being loaded (all other fields are invalid).
     * False: The security state has been loaded.
     */
    isLoading: boolean;
    /**
     * Message to display below the loading spinner.
     */
    loadingMessage: string;
    /**
     * True: The user is authenticated and the application is shown (or the Change Password interface).
     * False: The user is not authenticated and the Authentication User Interface is shown.
     */
    isAuthenticatedUser: boolean;
    /**
     * Save email address during registration process
     */
    registrationEmail: string;
    /**
     * Save password during registration process
     */
    registrationPassword: string;
};

export type RememberMeData = {
    user: string;
    rememberMe: boolean;
};

@Injectable({
    providedIn: 'root',
})
export class BluiAuthSecurityService {
    private readonly securityStateObs = new Subject<SecurityContext>();
    private isFirstRouteCaptured = false;
    private securityState: SecurityContext = {
        userId: undefined,
        email: undefined,
        rememberMeDetails: {
            email: undefined,
            rememberMe: undefined,
        },
        isAuthenticatedUser: false,
        isLoading: true,
        loadingMessage: undefined,
        registrationEmail: undefined,
        registrationPassword: undefined,
    };

    // Whenever the application loads for the first time, we may want to direct the user to their original destination, before they were redirected to the login screen.
    constructor(private readonly _router: Router, private readonly _bluiAuthConfig: BluiAuthConfig) {}

    /* Call this method to parse the on-load URL to identify which page to redirect to when the user is authenticated.
       If `defaultHomeRoute` is provided, then this route will be used when unable to identify the default redirect route via URL.
     */
    inferOnAuthenticatedRoute(defaultHomeRoute?: string): void {
        this._router.events.subscribe((event) => {
            if (event instanceof NavigationStart && !this.isFirstRouteCaptured) {
                this.isFirstRouteCaptured = true;
                const url = event.url;

                const isAuthModuleRoute =
                    matchesRoute(url, 'LOGIN') ||
                    matchesRoute(url, 'CONTACT_SUPPORT') ||
                    matchesRoute(url, 'CREATE_ACCOUNT') ||
                    matchesRoute(url, 'CREATE_ACCOUNT_INVITE') ||
                    matchesRoute(url, 'FORGOT_PASSWORD') ||
                    matchesRoute(url, 'RESET_PASSWORD') ||
                    matchesRoute(url, 'AUTH_WORKFLOW');
                const isEmptyRoute = !url || url === '' || url === '/';

                // If there is no information
                if ((isEmptyRoute || isAuthModuleRoute) && defaultHomeRoute) {
                    AUTH_ROUTES.ON_AUTHENTICATED = defaultHomeRoute;
                    return;
                }

                // If the initial route loaded is not part of the auth workflow, make it so authenticated users will redirect to it post-login.
                if (!isAuthModuleRoute) {
                    AUTH_ROUTES.ON_AUTHENTICATED = event.url;
                }
            }
        });
    }

    updateSecurityState(newState: Partial<SecurityContext>): void {
        this.setSecurityState(Object.assign(this.getSecurityState(), newState));
    }

    setSecurityState(newSecurityState: SecurityContext): void {
        this.securityState = newSecurityState;
        this.securityStateObs.next(this.securityState);
    }

    getSecurityState(): SecurityContext {
        return this.securityState;
    }

    securityStateChanges(): Observable<SecurityContext> {
        return this.securityStateObs;
    }

    setLoading(isLoading: boolean): void {
        !isLoading ? this.clearLoadingMessage() : '';
        this.updateSecurityState({ isLoading });
    }

    setLoadingMessage(loadingMessage: string): void {
        this.updateSecurityState({ loadingMessage });
    }

    clearLoadingMessage(): void {
        this.updateSecurityState({ loadingMessage: undefined });
    }

    // If the user has been authenticated, this function should be called.
    onUserAuthenticated(email: string, password: string, rememberMe: boolean): void {
        this.setSecurityState({
            email,
            userId: email,
            isAuthenticatedUser: true,
            isLoading: false,
            rememberMeDetails: {
                email: rememberMe ? email : undefined,
                rememberMe,
            },
            loadingMessage: this.securityState.loadingMessage,
            registrationEmail: undefined,
            registrationPassword: undefined,
        });
    }

    // If the user has been de-authenticated (either because they logged out or app started with no credentials),
    onUserNotAuthenticated(rememberMeDetails?: RememberMeData): void {
        const currState = this.getSecurityState();
        const rememberMe = rememberMeDetails ? rememberMeDetails.rememberMe : currState.rememberMeDetails.rememberMe;
        const email = rememberMeDetails ? rememberMeDetails.user : currState.rememberMeDetails.email;
        this.setSecurityState(
            Object.assign(currState, {
                isAuthenticatedUser: false,
                isLoading: false,
                isShowingChangePassword: false,
                rememberMeDetails: {
                    rememberMe,
                    email,
                },
            })
        );
    }
}

import { Component, EventEmitter, Input, OnInit, Output } from '@angular/core';
import { FormControl, ValidatorFn, Validators } from '@angular/forms';
import { BLUI_LOGIN_VALIDATOR_ERROR_NAME, BluiAuthConfig } from '../../services/config/auth-config';
import { BluiAuthTranslations } from '../../translations/auth-translations';
import { BluiAuthSecurityService } from '../../services/state/auth-security.service';
import { AuthErrorStateMatcher } from '../../util/matcher';

@Component({
    selector: 'blui-email-field',
    styles: [
        `
            mat-form-field {
                width: 100%;
                margin-bottom: 24px;
            }

            @media only screen and (max-width: 600px) {
                mat-form-field {
                    margin-bottom: 16px;
                }
            }
        `,
    ],
    template: `
        <mat-form-field appearance="fill">
            <mat-label>{{ translate().GENERAL.EMAIL_FORM_LABEL }}</mat-label>
            <input
                id="blui-email"
                name="email"
                type="email"
                matInput
                autocomplete="off"
                (ngModelChange)="edit.emit(emailFormControl.value)"
                (focus)="touchedIdField = true; idFieldActive = true"
                (blur)="idFieldActive = false"
                [formControl]="emailFormControl"
                [errorStateMatcher]="matcher"
                (keyup.enter)="enter.emit()"
            />
            <mat-error
            id="email-helper-text"
                *ngIf="
                    !manualErrorMessage &&
                    isEmailFormDirty() &&
                    emailFormControl.hasError('email') &&
                    !emailFormControl.hasError('required') &&
                    !emailFormControl.hasError(customErrorName)
                "
                [innerHTML]="translate().GENERAL.EMAIL_INVALID_ERROR"
            >
            </mat-error>
            <mat-error
                *ngIf="!manualErrorMessage && isEmailFormDirty() && emailFormControl.hasError('required')"
                [innerHTML]="translate().GENERAL.IS_REQUIRED_ERROR(translate().GENERAL.EMAIL_FORM_LABEL)"
            >
            </mat-error>
            <mat-error
                *ngIf="!manualErrorMessage && isEmailFormDirty() && emailFormControl.hasError(customErrorName)"
                [innerHTML]="emailFormControl.errors[customErrorName].message"
            >
            </mat-error>
            <mat-error *ngIf="manualErrorMessage" [innerHTML]="manualErrorMessage"> </mat-error>
        </mat-form-field>
    `,
})
export class EmailFieldComponent implements OnInit {
    @Input() customEmailValidator: ValidatorFn;
    @Input() rememberLoginEmail = false;
    @Input() manualErrorMessage: string;
    @Input() rememberRegistrationEmail = false;
    @Output() edit: EventEmitter<string> = new EventEmitter<string>();
    @Output() enter: EventEmitter<void> = new EventEmitter<void>();

    emailFormControl: FormControl;
    idFieldActive: boolean;
    touchedIdField: boolean;

    matcher = new AuthErrorStateMatcher();
    customErrorName = BLUI_LOGIN_VALIDATOR_ERROR_NAME;

    constructor(
        private readonly _bluiAuthConfig: BluiAuthConfig,
        private readonly _bluiSecurityService: BluiAuthSecurityService
    ) {}

    ngOnInit(): void {
        const emailValidators = [
            Validators.required,
            Validators.email,
            Validators.pattern(/^[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}$/i),
        ];
        if (this.customEmailValidator || this._bluiAuthConfig.customEmailValidator) {
            emailValidators.push(this.customEmailValidator || this._bluiAuthConfig.customEmailValidator);
        }
        this.emailFormControl = new FormControl(this.showEmail(), emailValidators);
    }

    ngOnChanges(): void {
        this.matcher.setManualError(this.manualErrorMessage);
    }

    showEmail(): string {
        if (this.rememberLoginEmail) {
            return this._bluiSecurityService.getSecurityState().rememberMeDetails.email;
        } else if (this.rememberRegistrationEmail) {
            return this._bluiSecurityService.getSecurityState().registrationEmail;
        }
        return '';
    }

    isEmailFormDirty(): boolean {
        return (
            !this.idFieldActive && this.touchedIdField && (this.emailFormControl.dirty || this.emailFormControl.touched)
        );
    }

    translate(): BluiAuthTranslations {
        return this._bluiAuthConfig.getTranslations();
    }
}

import { Component, ElementRef, EventEmitter, Input, OnInit, Output, ViewChild } from '@angular/core';
import { AbstractControl, FormControl, ValidationErrors, ValidatorFn } from '@angular/forms';
import { BluiAuthConfig } from '../../services/config/auth-config';
import { BluiAuthTranslations } from '../../translations/auth-translations';
import { BluiAuthSecurityService } from '../../services/state/auth-security.service';
import { CrossFieldErrorMatcher } from '../../util/matcher';

@Component({
    selector: 'blui-password-field',
    styles: [
        `
            mat-form-field {
                width: 100%;
            }
        `,
    ],
    template: `
        <mat-form-field appearance="fill">
            <mat-label>{{ label || translate().GENERAL.PASSWORD_FORM_LABEL }}</mat-label>
            <input
                matInput
                id="blui-password"
                #bluiPasswordField
                name="password"
                autocomplete="off"
                (ngModelChange)="edit.emit(passwordFormControl.value)"
                [type]="isPasswordVisible ? 'text' : 'password'"
                [formControl]="passwordFormControl"
                [errorStateMatcher]="matcher"
                (keydown.enter)="enter.emit()"
            />
            <button id="visibilityIcon" type="button" mat-icon-button matSuffix (click)="togglePasswordVisibility()">
                <mat-icon>{{ isPasswordVisible ? 'visibility' : 'visibility_off' }}</mat-icon>
            </button>
            <mat-error
                *ngIf="!manualErrorMessage && passwordFormControl.hasError('mismatch')"
                [innerHTML]="translate().GENERAL.PASSWORD_MISMATCH_ERROR"
            ></mat-error>
            <mat-error *ngIf="manualErrorMessage" [innerHTML]="manualErrorMessage"> </mat-error>
        </mat-form-field>
    `,
})
export class PasswordFieldComponent implements OnInit {
    @Input() rememberPassword: false;
    @Input() label: string;
    @Input() shouldMatch: FormControl;
    @Input() passwordsMatch: boolean;
    @Input() manualErrorMessage: string;

    @Output() passwordsMatchChange: EventEmitter<boolean> = new EventEmitter<boolean>();
    @Output() enter: EventEmitter<void> = new EventEmitter<void>();
    @Output() edit: EventEmitter<string> = new EventEmitter<string>();
    @ViewChild('bluiPasswordField') passwordInputElement: ElementRef;

    isPasswordVisible = false;
    passwordFormControl: FormControl;
    matcher = new CrossFieldErrorMatcher();

    constructor(
        private readonly _bluiAuthConfig: BluiAuthConfig,
        private readonly _bluiSecurityService: BluiAuthSecurityService
    ) {}

    ngOnInit(): void {
        const rememberedPassword = this.rememberPassword
            ? this._bluiSecurityService.getSecurityState().registrationPassword
            : '';
        this.passwordFormControl = new FormControl(rememberedPassword ? rememberedPassword : '', [
            this._passwordsMatchValidator(),
        ]);
    }

    ngOnChanges(): void {
        this.matcher.setManualError(this.manualErrorMessage);
    }

    private _passwordsMatchValidator(): ValidatorFn {
        return (control: AbstractControl): ValidationErrors => {
            if (!this.shouldMatch) {
                return;
            }
            const passwordsMatch =
                this.shouldMatch && this.shouldMatch.value && control.value === this.shouldMatch.value;
            this.passwordsMatchChange.emit(passwordsMatch);
            if (!passwordsMatch) {
                return { mismatch: { message: '' } };
            }
        };
    }

    translate(): BluiAuthTranslations {
        return this._bluiAuthConfig.getTranslations();
    }

    togglePasswordVisibility(): void {
        this.isPasswordVisible = !this.isPasswordVisible;
    }
}

