        <div class="blui-auth-full-height">
            <form>
                <blui-email-field
                    [rememberRegistrationEmail]="true"
                    [customEmailValidator]="customEmailValidator"
                    (enter)="advance.emit()"
                    (edit)="updateEmail($event)"
                ></blui-email-field>
            </form>
